// src/components/Header.js
import React from "react";
import "./Header.css";

function Header() {
    return (
        <header className="gnav-header">
            <div className="gnav-container">
            <div className="gnav-container2">
                {/* Logo */}
                <div className="logo">
                    <img
                        src="/SESBridge.png"
                        alt="SES Bridge"
                    />
                SESで業界活力を
                </div>
                {/* Navigation Links */}
                <nav className="gnav-links">
                    <a href="#home">ホーム</a>
                    <a href="#reviews">企業クチコミ</a>
                    <a href="#salaries">給与調査</a>
                </nav>

                {/* Search and Actions */}
                <div className="gnav-actions">
                    <input
                        type="text"
                        placeholder="職種、キーワード、会社名"
                        className="search-input"
                    />
                    <button className="search-button">求人検索</button>
                </div>
            </div>
            </div>
        </header>
    );
}

export default Header;
